        const apiKey ='1c'
        fetch(' https://api.openweathermap.org/data/2.5/weather?q={city name}&appid={API key}')
        .then(response => response.json())
        .then(json => console.log(json))
    }

    return (
        <div className="App">
            <h1>Weather App</h1>
